(("undefined"!=typeof globalThis?globalThis:self).makoChunk_antd=("undefined"!=typeof globalThis?globalThis:self).makoChunk_antd||[]).push([["903974bf"],{"903974bf":function(e,a,t){"use strict";t.d(a,"__esModule",{value:!0}),t.d(a,"texts",{enumerable:!0,get:function(){return o;}}),t("28f3d43d");let o=[{value:"Ant Design React is dedicated to providing a ",paraId:0},{value:"good development experience",paraId:0},{value:" for programmers. Before starting, it is recommended to learn ",paraId:0},{value:"React",paraId:0},{value:" first, and correctly install and configure ",paraId:0},{value:"Node.js",paraId:0},{value:" v16 or above.",paraId:0},{value:"The official guide also assumes that you have intermediate knowledge about HTML, CSS, and JavaScript, and React. If you are just starting to learn front-end or React, it may not be the best idea to use the UI framework as your first step.",paraId:1},{value:"Finally, if you are working in a local development environment, please refer to ",paraId:2},{value:"Scaffolding Guide",paraId:2},{value:" to create a new project.",paraId:2},{value:"Here is a simple online codesandbox demo of an Ant Design component to show the usage of Ant Design React.",paraId:3,tocIndex:0},{value:"Follow the steps below to play around with Ant Design yourself:",paraId:4},{value:"Visit ",paraId:5,tocIndex:2},{value:"https://u.ant.design/reproduce",paraId:5,tocIndex:2},{value:" to create a codesandbox -- don't forget to press the save button as well to create a new instance.",paraId:5,tocIndex:2},{value:"Replace the contents of ",paraId:6,tocIndex:3},{value:"index.js",paraId:6,tocIndex:3},{value:" with the following code. As you can see, there is no difference between antd's components and typical React components.",paraId:6,tocIndex:3},{value:"If you have already set things up by following the ",paraId:7,tocIndex:3},{value:"Use with create-react-app",paraId:8,tocIndex:3},{value:", replace the content of ",paraId:7,tocIndex:3},{value:"/src/index.js",paraId:7,tocIndex:3},{value:" as follows:",paraId:7,tocIndex:3},{value:"import React, { useState } from 'react';\nimport { DatePicker, message } from 'antd';\nimport { createRoot } from 'react-dom/client';\n\nimport './index.css';\n\nconst App = () => {\n  const [date, setDate] = useState(null);\n  const [messageApi, contextHolder] = message.useMessage();\n  const handleChange = (value) => {\n    messageApi.info(`Selected Date: ${value ? value.format('YYYY-MM-DD') : 'None'}`);\n    setDate(value);\n  };\n  return (\n    <div style={{ width: 400, margin: '100px auto' }}>\n      <DatePicker onChange={handleChange} />\n      <div style={{ marginTop: 16 }}>\n        Selected Date: {date ? date.format('YYYY-MM-DD') : 'None'}\n      </div>\n      {contextHolder}\n    </div>\n  );\n};\n\ncreateRoot(document.getElementById('root')).render(<App />);\n",paraId:9,tocIndex:3},{value:"You can view the list of components in the side menu of the Components page, such as the ",paraId:10,tocIndex:4},{value:"Alert",paraId:11,tocIndex:4},{value:" component. Plenty of examples are also provided in the component pages and API documentation as well.",paraId:10,tocIndex:4},{value:'Click the "Open in Editor" icon in the first example to open an editor with source code to use out-of-the-box. Now you can import the ',paraId:12,tocIndex:4},{value:"Alert",paraId:12,tocIndex:4},{value:" component into the codesandbox:",paraId:12,tocIndex:4},{value:"- import { DatePicker, message } from 'antd';\n+ import { DatePicker, message, Alert } from 'antd';\n",paraId:13,tocIndex:4},{value:"Now add the following jsx inside the ",paraId:14,tocIndex:4},{value:"render",paraId:14,tocIndex:4},{value:" function.",paraId:14,tocIndex:4},{value:"  <DatePicker onChange={value => this.handleChange(value)} />\n  <div style={{ marginTop: 20 }}>\n-   Selected Date: {date ? date.format('YYYY-MM-DD') : 'None'}\n+   <Alert title=\"Selected Date\" description={date ? date.format('YYYY-MM-DD') : 'None'} />\n  </div>\n",paraId:15,tocIndex:4},{value:"Select a date, and you can see the effect in the preview area on the right:",paraId:16,tocIndex:4},{value:"OK! Now that you know the basics of using antd components, you are welcome to explore more components in the codesandbox. When reporting a bug with ant design, we also strongly recommend using codesandbox to provide a reproducible demo as well.",paraId:17,tocIndex:4},{value:"During actual real-world project development, you will most likely need a development workflow consisting of ",paraId:18,tocIndex:5},{value:"compile/build/deploy/lint/debug/",paraId:18,tocIndex:5},{value:" deployment. You can read the following documents on the subject or use the following scaffolds and examples provided below:",paraId:18,tocIndex:5},{value:"Ant Design Pro",paraId:19,tocIndex:5},{value:"create-next-app",paraId:19,tocIndex:5},{value:"More scaffolds at ",paraId:19,tocIndex:5},{value:"Scaffold Market",paraId:19,tocIndex:5},{value:"If you use ",paraId:20,tocIndex:6},{value:"create-react-app",paraId:20,tocIndex:6},{value:" follow the instructions ",paraId:20,tocIndex:6},{value:"here",paraId:21,tocIndex:6},{value:" instead.",paraId:20,tocIndex:6},{value:"Jest does not support ",paraId:22,tocIndex:6},{value:"esm",paraId:22,tocIndex:6},{value:" modules, and Ant Design uses them. In order to test your Ant Design application with Jest you have to add the following to your Jest config :",paraId:22,tocIndex:6},{value:'"transform": { "^.+\\\\.(ts|tsx|js|jsx)?$": "ts-jest" }\n',paraId:23,tocIndex:6},{value:"antd",paraId:24,tocIndex:7},{value:" supports tree shaking of ES modules, so using ",paraId:24,tocIndex:7},{value:"import { Button } from 'antd';",paraId:24,tocIndex:7},{value:" would drop js code you didn't use.",paraId:24,tocIndex:7},{value:"If you want to customize your workflow, we recommend using ",paraId:25,tocIndex:8},{value:"webpack",paraId:25,tocIndex:8},{value:" or ",paraId:25,tocIndex:8},{value:"vite",paraId:25,tocIndex:8},{value:" to build and debug code. You can try out plenty of ",paraId:25,tocIndex:8},{value:"boilerplates",paraId:25,tocIndex:8},{value:" available in the React ecosystem.",paraId:25,tocIndex:8},{value:"There are also some ",paraId:26,tocIndex:8},{value:"scaffolds",paraId:26,tocIndex:8},{value:" which have already been integrated into antd, so you can try and start with one of these and even contribute.",paraId:26,tocIndex:8}];}}]);